import React, { useState } from "react";
import TextField from "@material-ui/core/TextField";
import { useForm } from "../../hooks/useForm";
import DateFnsUtils from "@date-io/date-fns";
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider,
} from "@material-ui/pickers";
export const MandaderoScreen = () => {
  const style_input = {
    margin: "15px 0",
    width: "100%",
  };

  const [{ fecha, name }, handleChange, reset] = useForm({
    name: "",
    fecha: "",
  });

  const [state, setstate] = useState(initialState);
  useState;

  const handleSubmit = (e) => {
    e.preventDefault();
  };
  return (
    <>
      <div className="auth__container">
        <h1>Publicar Viaje</h1>
        <form onSubmit={handleSubmit} className="form-login">
          <TextField
            type="text"
            name="name"
            onChange={handleChange}
            value={name}
            style={style_input}
            label="Nombre Completo"
          />
          <TextField
            type="text"
            name="name"
            onChange={handleChange}
            value={name}
            style={style_input}
            label="Nombre Completo"
          />
          <MuiPickersUtilsProvider utils={DateFnsUtils}>
            <KeyboardDatePicker
              style={style_input}
              disableToolbar
              variant="inline"
              format="dd/MM/yyyy"
              margin="normal"
              label="Dia del viaje"
              value={fecha}
              name="fecha"
              onChange={handleChange}
            />
          </MuiPickersUtilsProvider>
          <TextField
            type="text"
            name="name"
            onChange={handleChange}
            value={name}
            style={style_input}
            label="Nombre Completo"
          />
          <TextField
            type="text"
            name="name"
            onChange={handleChange}
            value={name}
            style={style_input}
            label="Nombre Completo"
          />
          <TextField
            type="text"
            name="name"
            onChange={handleChange}
            value={name}
            style={style_input}
            label="Nombre Completo"
          />
        </form>
      </div>
    </>
  );
};
